        roll = xr.DataArray(np.array(self.synth_roll), dims=['time'], coords={'time': tme_coord})

        return xr.Dataset({'heading': (['time'], heading), 'heave': (['time'], heave), 'pitch': (['time'], pitch),
                           'roll': (['time'], roll)}, coords={'time': tme_coord}).chunk()

